import React from 'react';
import ProgressUpdater from './ProgressUpdater';
import Hint from './Hint';

class Overloading extends React.Component{
	constructor(props){
		super(props)
		this.state={
			progress: "todo"
		}
	}

	updateProgressState(progress){
		this.setState({
			progress: progress
		});
	}


	render(){
		return (
			<div>
				<ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            mwahaha – we aren't done with <b>functions</b> quite yet! there's one last concept we need to address, called <b>overloading</b>.
	            <h3>overloading, as in you put too many clothes in the laundry machine?</h3>
	            not rly... but appreciate the effort. <b>overloading</b>, or more explicitly called method overloading, allows <b>multiple</b> functions to have the <b>same name</b>, as long as the <b>number of parameters</b> and/or the <b>type of parameters</b> are <b>different</b>. (<b className="note">psst. need a reminder</b> on what a parameter is? check out the <b className="pageName">functions page</b>!)
	            <h3>woah that definition was overloaded with technical language</h3>
	            dw! let's break it down.
	            <br/>
	            two different functions can have the <b>same function name</b> as long as <b>at least one</b> of the following conditions is true:
	            <ul>
	            	<li><b>the number of parameters in each function is different</b> – for example, if one function takes in one input and the other function takes in two, then those functions can have the same name</li>
	            	<li><b>the type of parameters in each function is different</b> – for example, if one function takes in a String and an int and the other function takes in a String and a double, then those functions can have the same name</li>
	            </ul>
	            to illustrate the concept of function overloading, let's go through <b>examples pertaining to each of the above conditions</b>.
	            <h3>overloaded functions with a different number of parameters</h3>

	            <h3>overloaded functions with different types of parameters</h3>
	            <h3>feelin' overloaded with info? well good news! time to recap!</h3>
	            <b>dang!</b> you made it to recap!
				<br/><br/>
				<h3>pit stop</h3>
	            <ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            ...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default Overloading;
